import React, { Component } from 'react'
import PropTypes from 'prop-types'
import './App.scss'
import MapComponent from './components/MapComponent/'

export class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
      viewport: null,
    }
  }
  render() {
    return (
      <div className="App">
        <MapComponent></MapComponent>
      </div>
    )
  }
}

export default App;
